function Room(){

    const[uuidV4,setUuidV4] = useState("");
    useEffect(()=>{
        fetch("http://localhost:9000/room")
            .then(res =>{
                console.log(res.roomId)
                res.text();
            }).then(res =>{
                setUuidV4(res);
                console.log(res)
            })
    })

    return (
        <div id="video-grid"></div>
        
    );
}

export default Room;
